    id uuid DEFAULT public.uuid_generate_v4() NOT NULL,
    email character varying(255) NOT NULL,
    password_hash character varying(255) NOT NULL,
    active boolean DEFAULT true NOT NULL,
    reset_password_token character varying(255),
    reset_password_token_expires_at timestamp with time zone,
    email_verified boolean DEFAULT false NOT NULL,
    email_verification_token character varying(255),
    email_verification_token_expires_at timestamp with time zone,
    pending_email character varying(255),
    pending_email_verification_token character varying(255),
    pending_email_verification_token_expires_at timestamp with time zone,
    email_change_verification_count integer DEFAULT 0 NOT NULL,
    email_change_verification_window_started_at timestamp with time zone,
    password_last_changed_at timestamp with time zone,
    gdpr_erasure_requested_at timestamp with time zone,
    gdpr_erasure_completed_at timestamp with time zone,
    last_export_requested_at timestamp with time zone,
    last_export_delivered_at timestamp with time zone,
    token_version integer DEFAULT 0 NOT NULL,
    role character varying(20) DEFAULT 'user'::character varying NOT NULL,
    created_at timestamp without time zone DEFAULT now() NOT NULL,
    updated_at timestamp without time zone DEFAULT now() NOT NULL,
    terms_accepted_at timestamp with time zone,
    privacy_accepted_at timestamp with time zone,
    two_factor_enabled boolean DEFAULT false NOT NULL,
    two_factor_secret character varying(255),
    two_factor_confirmed_at timestamp with time zone,
    CONSTRAINT "CHK_users_role" CHECK (((role)::text = ANY ((ARRAY['user'::character varying, 'admin'::character varying, 'monitoring'::character varying, 'teacher'::character varying, 'author'::character varying])::text[])))
);


